import React from 'react';
import GlobalStyles from './GlobalStyles'

import Links from '../components/Links'


const Index = () => {
  return (
    <>
      <h1>dev</h1>
      <ul>
        <Links>AAA</Links>
      </ul>

      <GlobalStyles />
    </>
  )
}

export default Index
